import React, { Component } from 'react';
import {
  Row,
  Col,
  FormGroup
 } from 'reactstrap'

export default class ContactUs extends Component {
  constructor(props){
    super(props)
    this.state = {
        form: {
            industry: "",
            email_address: "",
            notes: ""
        },
    }
  }
  render() {
    return (
      <section id="contact">
      </section>
    );
  }
}
